addEventHandler("onClientKey", root, function(key, press)
    if pesquisarAtivo then 
        if (press) then 
            for i,v in ipairs(proibidos) do 
                if key == v then 
                    return 
                end
            end
            if textoPesquisar == "|" then textoPesquisar = "" end
            if #textoPesquisar >= 17 then return end
            for k, nome in pairs(tabelaCategorias.nomes) do
                if string.lower(textoPesquisar):sub(1, #textoPesquisar) == string.lower(nome):sub(1, #textoPesquisar) then
                    textoFiltrado = tostring(nome)
                end
            end
            textoPesquisar = textoPesquisar .. tostring(key)
            if #textoPesquisar >=18 then 
                textoPesquisar = textoPesquisar:sub(1, #textoPesquisar - #textoPesquisar)
            end
        end
    end
end)

