addEventHandler("onClientRender", root, function() -- // esp box
    if espBox and enableEsp and espBoxSelecionado == "3D" then
    for _, player in ipairs(getElementsByType("player")) do
        if player ~= localPlayer then
            local x, y, z = getElementPosition(player)
            local minX, minY, minZ, maxX, maxY, maxZ = getElementBoundingBox(player)
            if minX then
                local frontTopLeft = { getScreenFromWorldPosition(x + minX, y + maxY, z + maxZ) }
                local frontTopRight = { getScreenFromWorldPosition(x + maxX, y + maxY, z + maxZ) }
                local frontBottomLeft = { getScreenFromWorldPosition(x + minX, y + maxY, z + minZ) }
                local frontBottomRight = { getScreenFromWorldPosition(x + maxX, y + maxY, z + minZ) }
                local backTopLeft = { getScreenFromWorldPosition(x + minX, y + minY, z + maxZ) }
                local backTopRight = { getScreenFromWorldPosition(x + maxX, y + minY, z + maxZ) }
                local backBottomLeft = { getScreenFromWorldPosition(x + minX, y + minY, z + minZ) }
                local backBottomRight = { getScreenFromWorldPosition(x + maxX, y + minY, z + minZ) }

                local function drawLine(coords1, coords2)
                    if coords1[1] and coords2[1] then
                        dxDrawLine(coords1[1], coords1[2], coords2[1], coords2[2], boxColor, 2)
                    end
                end

                drawLine(frontTopLeft, frontTopRight)
                drawLine(frontTopRight, frontBottomRight)
                drawLine(frontBottomRight, frontBottomLeft)
                drawLine(frontBottomLeft, frontTopLeft)

                drawLine(backTopLeft, backTopRight)
                drawLine(backTopRight, backBottomRight)
                drawLine(backBottomRight, backBottomLeft)
                drawLine(backBottomLeft, backTopLeft)

                drawLine(frontTopLeft, backTopLeft)
                drawLine(frontTopRight, backTopRight)
                drawLine(frontBottomLeft, backBottomLeft)
                drawLine(frontBottomRight, backBottomRight)
            end
        end
    end
end
end)



