ShiftBoostFunction = function()
    local veh = getPedOccupiedVehicle(localPlayer) or false 
    if veh then 
        local rx,ry,rz = getElementRotation(veh) 
        local vx,vy,vz = getElementVelocity(veh)
        local speed = 0.2 
        
        local forwardX = -math.sin(math.rad(rz))
        local forwardY = math.cos(math.rad(rz))
        
        setElementVelocity(veh, vx + forwardX * speed, vy + forwardY * speed, vz)
    end
end
