botaoACDesativar1 = svgCreate(500,500,botaoACDesativar)
local buscandoText = "Buscando por Anti-Cheat"

function findACmenu ()

    dxDrawImage(x * 454 / x,y * 308  / y, 435, 194,backgroundFindAC1, 0, 0, 0,tocolor(255, 255, 255), false)
    dxDrawText (buscandoText,x * 586 / x,y * 309 / y, 172, 24 , tocolor ( 255, 255, 255, 255 ), 1.4, "default" )
    dxDrawText ("Nome: " ..tostring(infoAC[1]),x * 539 / x,y * 353 / y, 172, 24 , tocolor ( 255, 255, 255, 255 ), 1.4, "default" )
    dxDrawText ("Status: ",x * 539 / x,y * 376 / y, 172, 24 , tocolor ( 255, 255, 255, 255 ), 1.4, "default" )
    
    dxDrawText ("Risco: ",x * 539 / x,y * 398 / y, 172, 24 , tocolor ( 255, 255, 255, 255 ), 1.4, "default" )
    dxDrawImage(x * 458 / x,y * 474  / y, 207.5, 25,botaoACvoltar1, 0, 0, 0, isMouseInPosition(x * 458 / x,y * 474  / y, 207.5, 25) and tocolor (255,255,255, 150) or tocolor(255, 255, 255), false)
    dxDrawImage(x * 678 / x,y * 474  / y, 207.5, 25,botaoACDesativar1, 0, 0, 0,isMouseInPosition(x * 678 / x,y * 474  / y, 207.5, 25) and tocolor(255,255,255,150) or tocolor(255, 255, 255), false)
    dxDrawText (tostring(infoAC[2]),x * 599 / x,y * 376 / y, 172, 24 , tocolor ( 64, 136, 30, 255 ), 1.4, "default" )
    dxDrawText (tostring(infoAC[3]),x * 590 / x,y * 398 / y, 172, 24 , tocolor ( 141, 32, 32, 255 ), 1.4, "default" )
end
local resourcesFind = {}
local antiCheats = {
    "Anti-Cheat",
    "[HORUS]AC",
    "[FANTASY]AC",
    "[FANTASY]Anti-Cheat",
    "PEGASUS",
    "pegasus",
    "ANTI-CHEAT",
    "AC",
    "[BVR]Anti-Cheat",
    "[BMR]Anti-Cheat",
    "[BCR]Anti-Cheat"
}

local nameAntiCheatEncontrado
addEventHandler("onClientResourceStart", root, function(res)
    local resourceName = getResourceName(res)
    table.insert(resourcesFind, resourceName)
end)

addEventHandler("onClientKey", root, function(key, press)
    if key == "mouse1" and press then
        if not renderizando then return end
        if isMouseInPosition(x * 716 / x, y * 239 / y, 47, 25) then
            if tabelaCategorias.abasAbertas[5] then
                weaponsXD[3] = not weaponsXD[3]
                addEventHandler("onClientRender", root, findACmenu)
                removeEventHandler("onClientRender", root, renderizarMenu)
                findACvisible = true
                for i, resourceName in ipairs(resourcesFind) do
                    for a, namePossivel in ipairs(antiCheats) do
                        if string.lower(resourceName) == string.lower(namePossivel) then
                            infoAC[1] = resourceName
                            infoAC[2] = "Ativado"
                            infoAC[3] = "Ultra"
                            buscandoText = "Anti-Cheat Encontrado"
                            nameAntiCheatEncontrado = resourceName
                            break  
                        end
                    end
                end
            end
        end
    end
end)

function disableACevents (sourceResource, functionName, isAllowedByACL, luaFilename, luaLineNumber, ...)
    if nameAntiCheatEncontrado then 
        local nameK = getResourceName(sourceResource)
        if sourceResource == nameAntiCheatEncontrado then 
            return "skip"
        end
    end
end


addEventHandler("onClientKey", root, function(key, press)
