function desenharEspNameNPC(player) -- // Esp NPC
    if not enableEsp then return end
    local x, y, z = getElementPosition(player)

    local screenX, screenY = getScreenFromWorldPosition(x, y, z+1)
    if not includePeds then return end
    if not espName then return end
    
    if screenX and screenY then
        local cor = tocolor(255, 255, 255, 255)
        local fonte = "default-bold" 
        local tamanho = 1.2 
        local px, py, pz = getElementPosition(localPlayer)
        local distance = getDistanceBetweenPoints3D(px, py, pz, x, y, z)
        local text = ' | ' .. math.floor(distance) .. 'm'
        local health = getElementHealth(player)
        
        
        if espDistance and espHealth then 
            dxDrawText("NPC" .. "" ..text .. "\nHealth: " ..tostring(health), screenX, screenY, screenX, screenY, cor, tamanho, fonte, "center", "center")
        elseif espDistance and not espHealth then 
            dxDrawText("NPC" .. "" ..text, screenX, screenY, screenX, screenY, cor, tamanho, fonte, "center", "center")
        elseif espHealth and not espDistance then 
            dxDrawText("NPC" .. "\nHealth: " ..tostring(health), screenX, screenY, screenX, screenY, cor, tamanho, fonte, "center", "center")
             
        elseif not espDistance and not espHealth then 
            dxDrawText("NPC", screenX, screenY, screenX, screenY, cor, tamanho, fonte, "center", "center")
        end
    end
end

