            {52, 53}, {43, 44}, {42, 43}, {22, 23}, {23, 24}, {24, 25},
            {25, 26}, {32, 33}, {33, 34}, {34, 35}, {35, 36}, {7, 6},
            {3, 1}, {8, 5},  {6, 7},  {31, 32},
            {22, 21}, {4, 3}, {21, 31}, {42, 1}, {52, 1}
