local function drawEspName(entity)
    if not enableEsp or not espName then return end
    
    local x, y, z = getElementPosition(entity)
    local screenX, screenY = getScreenFromWorldPosition(x, y, z + 1)
    
    if not screenX or not screenY then return end
    
    local cor = tocolor(255, 255, 255, 255)
    local fonte = "default-bold" 
    local tamanho = 1.2 
    local nome = getPlayerName(entity)
    local px, py, pz = getElementPosition(localPlayer)
    local distance = getDistanceBetweenPoints3D(px, py, pz, x, y, z)
    local text = ' | ' .. math.floor(distance) .. 'm'
    local id = getElementData(entity, "ID") or "N/A"
    
