    if espDistance then
        espText = espText .. text
    end
    if espID then
        espText = espText .. "\nID: " .. tostring(id)
    end
    if espHealth then 
        espText = espText .. "\nHealth:" ..tostring(getElementHealth(entity))
    end
    
    dxDrawText(espText, screenX, screenY, screenX, screenY, cor, tamanho, fonte, "center", "center")
end

