function renderLine()
    if not espLine or not enableEsp then return end
    
    local localPlayerX = getLocalPlayer()
    local meuX, meuY, meuZ = getElementPosition(localPlayerX)
    local x2, y2, z2 = getElementPosition(localPlayerX) 

    local color = tocolor(255, 255, 255, 255)
    local espLineZ = espLineSelecionado == "Up" and 3 or (espLineSelecionado == "Down" and -1 or 0)

    local function drawLineToPlayer(player)
        if player == localPlayerX or not includePeds then return end
        
        local x, y, z = getElementPosition(player)
        local screenX, screenY, hit = getScreenFromWorldPosition(x, y, z + 0.1)

        if hit then
            dxDrawLine3D(x, y, z, x2, y2, z2 + espLineZ, color, 2)
        end
    end

    for _, player in ipairs(getElementsByType("player")) do
        drawLineToPlayer(player)
    end

    if includePeds then
        for _, ped in ipairs(getElementsByType("ped")) do
            drawLineToPlayer(ped)
        end
    end
end

