local boxColor = tocolor(255,255,255,255)

addEventHandler("onClientRender", root, function()
    if espBox and enableEsp and espBoxSelecionado == "2D" then
    for _, player in ipairs(getElementsByType("player")) do
        if player ~= localPlayer then
            local x, y, z = getElementPosition(player)
            local minX, minY, minZ, maxX, maxY, maxZ = getElementBoundingBox(player)
            
            if minX then
                local frontLeft = { getScreenFromWorldPosition(x + minX, y, z + minZ) }
                local frontRight = { getScreenFromWorldPosition(x + maxX, y, z + minZ) }
                local backLeft = { getScreenFromWorldPosition(x + minX, y, z + maxZ) }
                local backRight = { getScreenFromWorldPosition(x + maxX, y, z + maxZ) }

                local function drawLine(coords1, coords2)
                    if coords1[1] and coords2[1] then
                        dxDrawLine(coords1[1], coords1[2], coords2[1], coords2[2], boxColor, 2)
                    end
                end
                drawLine(frontLeft, frontRight)
                drawLine(frontRight, backRight)
                drawLine(backRight, backLeft)
                drawLine(backLeft, frontLeft)
            end
            end
        end
    end
end)

